import React from "react";
import { ThemeProvider, lightGradient, base, centered } from "../styles/theme";
import {
  Hero,
  Container,
  Header,
  Column,
  Row,
  Subheader,
  Body
} from "../styles/common";
import Layout from "../components/layouts";

const Process = props => {
  // We believe in doing it right the first time!
  return (
    <Layout>
      <ThemeProvider theme={lightGradient(base)}>
        <Hero layout={centered}>
          <Container>
            <Row>
              <Header>
                Our goal is to increase client revenue and decrease wasteful
                processes.
              </Header>
              <Subheader>
                We never stop refining and improving operations, products and
                services.
              </Subheader>
            </Row>
          </Container>
        </Hero>
      </ThemeProvider>
    </Layout>
  );
};
export default Process;
